Types can either be open or closed. These properties interact with the (|) and (&) type operators like so: for(t: Closed, u: Closed) { t | u :: Closed }
for(t: Open, u: Type) { t | u :: Open }
for(t: Closed, u: Type) { t & u :: Closed }
for(t: Open, u: Open) { t & u :: Open } Types are closed iff their supertype is closed. Recall that type T = U; ...is translated into: type T { } <: U;
inst T for U; So for type-alias syntax, the defined type is closed iff the RHS type is closed. A type may have exactly one "open" instance, or many "closed" instances. If the equivalent of a WTy2 "open" type in Rust is considered to be a blanket impl (as opposed to an impl for a concrete type), then the rules Rust uses are actually a bit more flexible. It allows: struct S1;
struct S2;
struct S3; trait T1 {}
trait T2 {}
trait T3 {} impl <T: T2> T1 for T {} impl T1 for S1 {} impl T1 for S2 {} // This impl, if uncommented, will cause an overlap with the blanket impl, but
// only indirectly - the error message will not point to this line!
//impl T2 for S2 {} In my opinion, this is a mistake: the error message not highlighting the correct line is confusing to the programmer, the rules which allow this are necessarily more complicated and I would argue this pattern has very limited utility (OOP has proven that default instances for a type in terms of another are useful, but this can be achieved through much more principled means like Haskell's deriving via).

